import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import espressoImg from "./assets/espresso.png";
import refresherImg from "./assets/refreshercoffee.png";
import teaImg from "./assets/teacoffee.png";
import blendedImg from "./assets/chocolate.png";
import pastryImg from "./assets/pastry.png";
import CartIcon from "./CartIcon";
import "./App.css";

export default function CoffeeShop({ totalItems }) {
  const navigate = useNavigate();
  const [menuOpen, setMenuOpen] = useState(false);

  const toggleMenu = () => setMenuOpen((open) => !open);

  const buttonStyle = {
    backgroundColor: "#fff",
    border: "1px solid #ccc",
    borderRadius: "12px",
    padding: "10px",
    cursor: "pointer",
    width: "140px",
    boxShadow: "0 4px 8px rgba(0,0,0,0.1)",
    transition: "transform 0.2s",
  };

  const imgStyle = {
    width: "100px",
    height: "100px",
    objectFit: "cover",
    marginBottom: "0.5rem",
  };

  const labelStyle = {
    fontSize: "16px",
    fontWeight: "bold",
    color: "#5a3e1b",
  };

  const floatingMenuStyle = {
    position: "fixed",
    bottom: "20px",
    right: "20px",
    display: "flex",
    flexDirection: "column",
    gap: "10px",
    zIndex: 1000,
  };

  const hiddenStyle = { display: "none" };
  const visibleStyle = { display: "flex" };

  const menuButtonStyle = {
    backgroundColor: "#5a3e1b",
    color: "#fff",
    border: "none",
    borderRadius: "50%",
    width: "60px",
    height: "60px",
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
    fontSize: "24px",
    cursor: "pointer",
  };

  const products = [
    { key: "espresso", label: "Espresso", img: espressoImg, area: "espresso" },
    { key: "refresher", label: "Refresher", img: refresherImg, area: "refresher" },
    { key: "tea", label: "Tea", img: teaImg, area: "tea" },
    { key: "pastry", label: "Pastry", img: pastryImg, area: "pastry" },
    { key: "blended", label: "Blended Beverage", img: blendedImg, area: "blended" },
  ];

  return (
    <div style={{ textAlign: "center", paddingBottom: "80px" }}>
      <h2 style={{ color: "#5a3e1b" }}>Our Coffee Menu</h2>

      {/* Product grid */}
      <div
        style={{
          display: "grid",
          gridTemplateColumns: "1fr 1fr 1fr 1fr 1fr",
          gridTemplateRows: "auto auto",
          gridTemplateAreas: `
            ". espresso refresher tea ."
            ". . pastry blended ."
          `,
          maxWidth: "100%",
          margin: "1rem auto",
          gap: "2rem 2rem",
          padding: "0 1rem",
        }}
      >
        {products.map(({ key, label, img, area }) => (
          <div
            key={key}
            style={{
              gridArea: area,
              justifySelf: "center",
              alignSelf: "center",
              display: "flex",
              flexDirection: "column",
              alignItems: "center",
            }}
          >
            <button
              onClick={() => navigate(`/${key}`)}
              style={buttonStyle}
              aria-label={label}
              title={label}
            >
              <img src={img} alt={label} style={imgStyle} />
              <div style={labelStyle}>{label}</div>
            </button>
          </div>
        ))}
      </div>

      {/* Floating Menu */}
      <div style={floatingMenuStyle}>
        {/* Back Button */}
        <button
          onClick={() => {
            navigate("/");
            setMenuOpen(false);
          }}
          aria-label="Back to Home"
          title="Back to Home"
          style={{
            ...menuButtonStyle,
            width: "50px",
            height: "50px",
            background: "#eee",
            color: "#5a3e1b",
            boxShadow: "0 2px 6px rgba(0,0,0,0.15)",
            ...(menuOpen ? visibleStyle : hiddenStyle),
          }}
        >
          <svg
            xmlns="http://www.w3.org/2000/svg"
            width="24"
            height="24"
            fill="none"
            stroke="currentColor"
            strokeWidth="2"
            strokeLinecap="round"
            strokeLinejoin="round"
            viewBox="0 0 24 24"
          >
            <polyline points="15 18 9 12 15 6" />
          </svg>
        </button>

        {/* Cart Icon - Navigate to cart page */}
        <div
          onClick={() => navigate("/cart")}
          style={{
            ...(menuOpen ? visibleStyle : hiddenStyle),
            cursor: "pointer",
          }}
          aria-label="Go to Cart"
          title="Go to Cart"
          role="button"
          tabIndex={0}
          onKeyDown={(e) => {
            if (e.key === "Enter" || e.key === " ") {
              e.preventDefault();
              navigate("/cart");
            }
          }}
        >
          <CartIcon totalItems={totalItems} />
        </div>

        {/* Toggle Menu Button */}
        <button
          onClick={toggleMenu}
          aria-label={menuOpen ? "Close menu" : "Open menu"}
          title={menuOpen ? "Close menu" : "Open menu"}
          style={menuButtonStyle}
        >
          {menuOpen ? (
            <svg
              xmlns="http://www.w3.org/2000/svg"
              width="24"
              height="24"
              fill="none"
              stroke="currentColor"
              strokeWidth="2"
              strokeLinecap="round"
              strokeLinejoin="round"
              viewBox="0 0 24 24"
            >
              <line x1="18" y1="6" x2="6" y2="18" />
              <line x1="6" y1="6" x2="18" y2="18" />
            </svg>
          ) : (
            <svg
              xmlns="http://www.w3.org/2000/svg"
              width="24"
              height="24"
              fill="none"
              stroke="currentColor"
              strokeWidth="2"
              strokeLinecap="round"
              strokeLinejoin="round"
              viewBox="0 0 24 24"
            >
              <line x1="3" y1="12" x2="21" y2="12" />
              <line x1="3" y1="6" x2="21" y2="6" />
              <line x1="3" y1="18" x2="21" y2="18" />
            </svg>
          )}
        </button>
      </div>
    </div>
  );
}
